import React, { useState, useEffect, useCallback } from 'react';
import './css/ListeVideo.css';
import { getSelectedClub } from './../../config';

const ListeVideo = () => {
  const [videos, setVideos] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [activeTab, setActiveTab] = useState(0); // Onglet actif (par défaut le premier)

  const handleSearch = useCallback(async () => {
    setLoading(true);
    setError(null);
    const club = getSelectedClub();
    const folder = club ? club.name : '';
    const url = `https://ia-sport.oa.r.appspot.com/api/videos?folder=${encodeURIComponent(folder)}`;

    if (folder) {
      try {
        const response = await fetch(url);
        if (!response.ok) {
          throw new Error('Erreur lors de la récupération des vidéos');
        }
        const data = await response.json();
        setVideos(data.videos || []);
      } catch (error) {
        setError('Impossible de charger les vidéos. Veuillez réessayer plus tard.');
        console.error("Erreur lors de la recherche des vidéos:", error);
        setVideos([]);
      } finally {
        setLoading(false);
      }
    } else {
      setVideos([]);
      setLoading(false);
    }
  }, [getSelectedClub]);

  useEffect(() => {
    if (activeTab === 0) { // Rechercher les vidéos uniquement lorsque l'onglet des vidéos est actif
      handleSearch();
    }
  }, [activeTab, handleSearch]);

  const handleClick = (event) => {
    const videoElement = event.target;
    if (videoElement.paused) {
      videoElement.play();
    } else {
      videoElement.pause();
    }
  };

  const handleDoubleClick = (event) => {
    const videoElement = event.target;
    if (videoElement.requestFullscreen) {
      videoElement.requestFullscreen();
    } else if (videoElement.mozRequestFullScreen) {
      videoElement.mozRequestFullScreen();
    } else if (videoElement.webkitRequestFullscreen) {
      videoElement.webkitRequestFullscreen();
    } else if (videoElement.msRequestFullscreen) {
      videoElement.msRequestFullscreen();
    }
  };

  const renderContent = () => {
    switch (activeTab) {
      case 0:
        return (
          <ul className="liste-video-ul">
            {loading && <div className="loader">Chargement...</div>}
            {error && <div className="error-message">{error}</div>}
            {!loading && !error && videos.length > 0 ? (
              videos.map((video, index) => (
                <li key={index} className="liste-video-li">
                  <video 
                    className="liste-video-video" 
                    src={video.url} 
                    controls 
                    onClick={handleClick} 
                    onDoubleClick={handleDoubleClick}
                  >
                    <p>Your browser doesn't support HTML5 video. Here is a <a href={video.url}>link to the video</a> instead.</p>
                  </video>
                  <div className="liste-video-overlay">{video.name}</div>
                </li>
              ))
            ) : (
              <p className="no-videos">Aucune vidéo disponible</p>
            )}
          </ul>
        );
      case 1:
        return <div>Contenu de l'onglet 2</div>;
      case 2:
        return <div>Contenu de l'onglet 3</div>;
      case 3:
        return <div>Contenu de l'onglet 4</div>;
      case 4:
        return <div>Contenu de l'onglet 5</div>;
      default:
        return null;
    }
  };

  return (
    <div className="liste-video-container">
      <div className="tab-menu">
        <button className={activeTab === 0 ? "active" : ""} onClick={() => setActiveTab(0)}>Liste des vidéos</button>
        <button className={activeTab === 1 ? "active" : ""} onClick={() => setActiveTab(1)}>Onglet 2</button>
        <button className={activeTab === 2 ? "active" : ""} onClick={() => setActiveTab(2)}>Onglet 3</button>
        <button className={activeTab === 3 ? "active" : ""} onClick={() => setActiveTab(3)}>Onglet 4</button>
        <button className={activeTab === 4 ? "active" : ""} onClick={() => setActiveTab(4)}>Onglet 5</button>
      </div>

      <div className="liste-video-content">
        {renderContent()} {/* Affiche le contenu selon l'onglet sélectionné */}
      </div>
    </div>
  );
};

export default ListeVideo;
